INSERT INTO `v1_39d2e9f90055ddb30362da5d7ef68e12394695f57beab96d2b3e83353b2acf49` VALUES (10, 103411, "あら、私も本なのよ。\n「猫でもわかる麦しゅわの歴史」って\n本だけど、これを読んで麦しゅわへの\n理解を深めてね♪", 0, 0, 0.5, 38014, 11, 38014073, 1, 1);
